import React from 'react';
import Pin from './Pin.js';

const PinList = (props = [{id: "ck39re1mt00003h5u1qaa9nct", name: "dddd", location: Array(2), description: "dddd", color: "#61210f"}]) => {
  console.log(props)
  return (
    <React.Fragment>
      { props.pins.length > 0 ? props.pins.map(x => <Pin key={x.id} info={x} offset={props.offset} />) : null }
    </React.Fragment>
  )
}

export default PinList;
